pragma solidity ^0.5.0;

interface IERC20 {
    function totalSupply() external view returns (uint256);
    function balanceOf(address account) external view returns (uint256);
    function transfer(address recipient, uint256 amount) external returns (bool);
    function allowance(address owner, address spender) external view returns (uint256);
    function approve(address spender, uint256 amount) external returns (bool);
    function transferFrom(address sender, address recipient, uint256 amount) external returns (bool);
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(address indexed owner, address indexed spender, uint256 value);
}

pragma solidity ^0.5.0;
pragma experimental ABIEncoderV2;
contract BuyToken {

    // Ganache
    // IERC20 public USDT = IERC20(0x081ED2f1275858B157c979eb841E346d535f267E);
    // Ropsten
    IERC20 public USDT = IERC20(0x64C7181421E463Eb18968779ae3Fd0dA8B22346F);
    string public name = "Buy Token";
    address public owner;
    struct Listpoolbuytoken {
        address contractaddress;
        address owner;
        string icon;
        string symbol;
        string namepool;
        uint decimal;
    }
    Listpoolbuytoken[] public listpoolbuytoken;
    mapping(address => bool) public hasUser;
    mapping(address => bool) public hasOwner;
    mapping(address => bool) public hasbuyListed; 
    mapping(address => uint) public ratiotoken;
    mapping(address => uint) public balancetoken;
    mapping(address => uint) public timecreate;
    mapping(address => uint) public decimaltoken;
    mapping(address => string) public nametoken;
    mapping(address => string) public symboltoken;
    mapping(address => address) public ownerContract;
    function addbuytoken(address contractAddress, string memory iconPool, string memory symPool, string memory namePool, uint decimal,uint balancePool, uint ratio) public{
        require(balancePool>0);
        require(!hasbuyListed[contractAddress]);
        if(!hasbuyListed[contractAddress]) {
            IERC20(contractAddress).transferFrom(msg.sender, address(this), balancePool);
            listpoolbuytoken.push(Listpoolbuytoken(contractAddress, msg.sender, iconPool, symPool, namePool, decimal));
            ratiotoken[contractAddress] = ratio;
            balancetoken[contractAddress] = balancePool;
            timecreate[contractAddress] = block.timestamp;
            decimaltoken[contractAddress]= decimal;
            nametoken[contractAddress]= namePool;
            symboltoken[contractAddress]= symPool;
            hasbuyListed[contractAddress]= true;
            ownerContract[contractAddress] = msg.sender;
            hasOwner[msg.sender]= true;
        }
    }

    function buytoken(address contractAddress, uint amount) public {
        require(balancetoken[contractAddress]  >= amount);
        balancetoken[contractAddress] -=amount;
        IERC20(contractAddress).transfer(msg.sender,amount);
        USDT.transferFrom(msg.sender, ownerContract[contractAddress], amount * 10**6/ ratiotoken[contractAddress]);
        hasUser[msg.sender] = true;
    } 

    function getListpollbuytoken() public view returns(Listpoolbuytoken[] memory){
        return listpoolbuytoken;
    }

}
